import React from 'react';
import './AddExercise.css';

const AddExercise = () => {
  return (
    <div className='page'>
      <div className='container ctn-exercise'>
        <h1>Add An Exercise</h1>
        <form className='form-exercise'>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required />

          <label htmlFor="description">Description:</label>
          <textarea id="description" name="description" rows="4" cols="50"></textarea>

          <label htmlFor="calories_per_unit_duration">Calories per Unit Duration:</label>
          <input type="number" id="calories_per_unit_duration" name="calories_per_unit_duration" required />

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
}

export default AddExercise;
